@use 'reset' as *;
@use 'breakpoints' as *;
@use 'colors' as *;
@import url('https://fonts.googleapis.com/css2?family=Red+Hat+Display:wght@500;900&display=swap');

@mixin buttons($color, $hover) {
  padding: 16px 29px;
  border-radius: 29px;
  font-size: 1rem;
  font-weight: 900;
  background: $color;
  border: none;
  color: #fff;

  span {
    color: $version-color;
  }

  &:hover {
    background: $hover;
  }
}

* {
  // outline: solid 1px red;
}

body {
  font-family: 'Red Hat Display', sans-serif;
  overflow-x: hidden;

  p {
    color: $paragraph;
    font-size: 1rem;
    font-weight: 500;
    line-height: 26px;
  }
}

.m-width {
  max-width: 700px;

  @include xl {
    max-width: 70%;
  }
}

.download-btn {
  @include buttons($accent, $btn1-hover);
}

.btns {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  gap: 16px;
}

.center {
  padding: 0px 24px;
  display: flex;
  margin: 0 auto;
  flex-direction: column;
}

header {
  text-align: center;

  .faces {

    .d-image-left,
    .d-image-right {
      display: none;
    }

    display: flex;
    overflow: hidden;
    margin: 54px 0 48px -1.35rem;

    & img {
      width: 105%;
    }

    @include lg {
      gap: 400px;

      .d-image-left,
      .d-image-right {
        display: block;
      }

      .mobile-image {
        display: none;
      }

    }

  }

  .hero-text {

    h1 {
      font-size: 2.5em;
      color: $heading-text;
      font-family: Red Hat Display;
      margin-bottom: 20px;
      font-weight: 900;
      line-height: 44px;
      max-width: 900px;
    }

    .what-is-it-btn {
      @include buttons($secondary, $btn2-hover);
    }
  }

  .btns {
    margin: 32px 0 64px;
  }

  @include md {
    h1 {
      font-size: 3em;
    }

    .btns {
      flex-direction: row;
    }

    .container {
      max-width: 403px;
      align-self: center;
    }
  }

  @include xl {
    .logo {
      padding-top:80px;
      // margin-bottom: 500px;
    }
    // .container {}

