    .faces {
      gap: 60%;

      .d-image-left {
        margin-left: -12px;
      }

      .d-image-right {
        margin-right: -25px;
      }
    }

    // .hero-text {
    //   position: absolute;
    //   top: 10%;
    //   left: 35%;
    // }

    .container {
      position: absolute;
      top: 23%;
      max-width: 460px;
      // margin-bottom: 40px;
    }
  }
}

section {

  .marker {
    display: flex;
    flex-direction: column;
    align-items: center;

    hr {
      height: 84px;
      opacity: 0.25;

      color: $marker;
    }

    .footer-marker {
      z-index: 1;
      margin-bottom: -29px;
    }

    @include xl {
      margin-top: 60px;
    }
  }

  .section-marker {
    padding: 17px 17.5px;
    background-color: $semi-white;
    color: $paragraph;
    margin: -9px 0;
    display: flex;
    justify-content: center;
    border: 1px solid rgba(135, 135, 157, 0.25);
    border-radius: 30px;

  }

  .images {
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-gap: 24px 25px;
    width: 100%;
    max-width: 400px;
    justify-items: center;
    margin: 64px auto;

    img {
      // height: 143px;
      width: 100%;
      // width: 151px;
      border-radius: 8px;
    }

    @include md {
      grid-template-columns: repeat(4, 1fr);
      max-width: 1900px;
    }
  }

  &.center {
    align-items: center;
  }

  h3 {
    text-transform: uppercase;
    color: $accent;
    font-size: 1rem;
    font-weight: 900;
    letter-spacing: 4px;

  }

  h2 {
    font-size: 2rem;
    line-height: 36px;
    width: 104%;
    text-align: center;
    font-weight: 900;
    margin: 24px 0 34px 0;
  }

  @include md {
    h2 {
      font-size: 2.5em;
      max-width: 482px;
    }

    p {
      max-width: 548px;
    }

    .md-center {
      text-align: center;
      align-items: center;
    }

    @include xl {
      p {
        max-width: 463px;
        text-align: initial;
      }
    }
  }

}

footer {

  width: 100%;
  background: linear-gradient(rgba(77, 150, 168, 0.8) 100%, rgba(77, 150, 168, 0.8)100%), url(../assets/mobile/image-footer.jpg);
  background-size: cover;
  background-repeat: no-repeat;
  color: #fff;
  height: 428px;
